import React, {Component} from 'react'

class Artist extends Component {
	render() {
		return (
			<div className="sctn_artist">
				<h1 className="sctn_heading">Hilke Sens</h1>
				<div className="sctn_body">
					<p className="sctn_subheading">Seit JJJJ erschaffe ich Kunst.</p>
					<p className="sctn_subheading">Email: stubben@hotmail.de</p>
					<p className="sctn_subheading">Tel: 04743-9138612</p>
				</div>
			</div>
		)
	}
}

export default Artist
